**Describe the bug**

From [ONNX IR documentation](https://github.com/onnx/onnx/blob/master/docs/IR.md), the output of nested graph is allowed to not have shape and size info. So the output can be like this:

```
output {
  name: "2777"
}
```

However, if we add a **undefined** elem type to it (0 means "undefined" for elem type):

```
        output {
          name: "2777"
          type {
            tensor_type {
              elem_type: 0
              shape {
              }
            }
          }
        }
```

We will get the following error:

>   File "/home/dev/files/venv/onnx_dev/lib/python3.6/site-packages/onnxruntime/capi/onnxruntime_inference_collection.py", line 206, in __init__
>     self._create_inference_session(providers, provider_options)
>   File "/home/dev/files/venv/onnx_dev/lib/python3.6/site-packages/onnxruntime/capi/onnxruntime_inference_collection.py", line 228, in _create_inference_session
>     sess = C.InferenceSession(session_options, self._model_bytes, False, self._read_config_from_model)
> onnxruntime.capi.onnxruntime_pybind11_state.Fail: [ONNXRuntimeError] : 1 : FAIL : Node (If_1458) Op (If) [TypeInferenceError] Graph attribute inferencing failed: Type Error: Type (tensor()) of output arg (2777) of node (ConstantOfShape_1460) does not match expected type (tensor(int64)).

Is it an intended behavior (elem type defined as "undefined" is different from elem type undefined) or a bug?

