According to the onnx specification, the absence of bass in Dence is allowed, regardless of other layers. Therefore, the inference of the model described above should not lead to an error.

**Additional context**
I additionally created a network with Conv2D-layer without activation and biases, followed by a Relu-layer. Validation and inference of such a network were successful.

